import React from 'react'
// styles
import './Delivery.sass'
// components
import {Map, Title} from '../../../components/'

function Delivery() {
	return (
		<div className="delivery">
			<div className="delivery__map">
				<Map />
			</div>
			<Title title='Доставка' subtitle='швидка та якіска доставка' light/>
		</div>
	)
}

export default Delivery
